import Box from '@mui/material/Box';
import Drawer from '@mui/material/Drawer';
import Divider from '@mui/material/Divider';

type DrawerListProps = {
  open: boolean,
  setOpen: (newState: boolean) => void
}

export default function DrawerMainTable(props: DrawerListProps) {
  const { open, setOpen } = props
  const toggleDrawer = (newOpen: boolean) => () => {
    setOpen(newOpen);
  };

  const DrawerList = (
    <Box sx={{ width: 700 }} className="p-8" role="presentation" onClick={toggleDrawer(false)}>
      <h1 className="text-xl font-bold">
        Main drawer 
      </h1>
      <h3 className="text-md font-bold mt-4 mb-2">
        Details: 
      </h3>
      <div className='flex flex-col gap-2 m-2'>
        <div>
          Dessert:
        </div> 
        <div>
          Calories:
        </div>
        <div>
          Fat (g):
        </div>
        <div>
          Carbs (g):
        </div>
        <div>
          Protein (g):
        </div>
      </div>
      <Divider />
    </Box>
  );

  return (
    <div>
      <Drawer open={open} anchor={"right"} onClose={toggleDrawer(false)}>
        {DrawerList}
      </Drawer>
    </div>
  );
}
